textOriginal:
O bolsonarismo tem demonstrado alinhamento na reta final da eleição presidencial, às vésperas do segundo turno, numa espécie de vale-tudo para manter Jair Bolsonaro (PL) na presidência.

E, para derrotar Lula (PT) no 2º turno, há uma sintonia fina em ao menos três frentes:

propagar desinformação nas redes sociais sobre o TSE;
manter o assíduo uso político da religião, que vem desde o 1º turno;
assediar funcionários para que votem a favor do presidente sob pena de punição.
